  \"2015-02-04T19:38:36.193560\",\n\t\"name\": \"311-service-requests-tree-trims-0b313\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"All open and completed tree trim requests
  made to 311 since January 1, 2011. The Department of Streets and Sanitation maintains
  all trees growing in the public way and performs regular maintenance trimming in
  response to 311 requests. Crisis trimming is performed on an emergency basis in
  response to hazardous conditions such as broken or hanging branches. Requests that
  have been labeled as Duplicates are in the same geographic area and have been entered
  into 311u2019s Customer Service Requests (CSR) system at around the same time as
  a previous request. Duplicate requests are labeled as such in the Status field,
  as either \"Open - Dup\" or \"Completed - Dup.\" Data is updated daily.\",\n\t\"license_title\":
